There seems to be a frequent misunderstanding with this. With the existing code, it would increase the difficulty level after every challenge request as long as < 2 out of the last 20 challenges have failed. Only initially, at least 20 successful challenges are required to progress from the first difficulty level. 
(challenge_successes is overall not per difficulty level):

```python
if challenge_successes >= 20:
    if last_20_challenge_failed <= 1:
        difficulty = min(current_difficulty + 1, pow_max_difficulty)
    elif last_20_challenge_failed > 2:
        difficulty = max(current_difficulty - 1, pow_min_difficulty)
    else:
        difficulty = current_difficulty
```
The reason it's not leveling up for every new challenge request afterwards is because more than 2 of the last 20 challenges have failed, typically due to network congestion. When this happens, challenges aren't even received from the vali and vice versa, which are then automatically treated as failed (and you won't see this in your miner logs).
